import React from "react";
import './NavBar.css';


const NavBar = () => {
  return (
    <nav>
        <div className="nav">
            <div className="nav__logo">
                <p className="brand-logo">Game Swap</p>
            </div>
            <ul>
                <li><a href="/sign-up">Sign Up</a></li>
                <li><a href="/login">Login</a></li>
            </ul> 
        </div>    
    </nav>
  );
};

export default NavBar;
